import EducationPage from "./Pages/EducationPage";
import WorkPage from "./Pages/WorkPage";
import ProjectsPage from "./Pages/ProjectsPage";
import InterestsPage from "./Pages/InterestsPage";
import ContactPage from "./Pages/ContactPage";



function App() { 

  return (
    <div className="App">
      {/* <MainPage/> */}
      <NavHeader />
      <div>
        <p>LK</p>
        <p>Resume</p>
        <p>Projects</p>
        <p>Education</p>
        <p>Work</p>
        <p>Interests</p>
        <p>Contact</p>
      </div>
      <LandingPage/>
      <ResumePage/>
      <EducationPage/>
      <WorkPage/>
      <ProjectsPage/>
      <InterestsPage/>
      <ContactPage/>

    </div>
  );
}

export default App;
